import React, { Component } from 'react'

export default class AthleteInfo extends Component {
    constructor() {
        super();
        this.state = {
            athletes: [
                {
                    id: 1,
                    name: "Pekka Routalempi",
                },
                {
                    id: 2,
                    name: "Rauno Repomies",
                },
            ],
        };
    }

    render() {
        const {athletes} = this.state;
        return (
            <div>
                {athletes.map((athlete) => (
                    <h1>{athlete.name}</h1>
                ))}
            </div>
        )
    }
}
